1. Vi förbinder oss i att skydda våra användares integritet. Med denna policy förklarar vi hur vi behandlar din personliga information. 
 2. Det kan förekomma att vi samlar in, lagrar och använder följande typer av personuppgifter: 
 * Information om din enhet och om dina besök till och användning av den här applikationen (inklusive din IP-adress, geografiskt läge, webbläsartyp och -version, operativsystem, referenskälla, besökstid och navigeringsvägar); 
 * Information som du ger oss när du registrerar dig;
 * Din e-mail och namn när du skapar din profil;
 * Information som du lämnar när du fyller i hundens profil på vår applikation;
 * Information som finns i eller relaterar till kommunikation som du skickar till oss eller skickar via vår ansökan (inklusive kommunikationsinnehåll och metadata i samband med kommunikationen); 
 * annan personlig information som du väljer att skicka till oss. 
 3. Användning av Dogo av minderåriga 
Du måste vara 18 år eller i myndig ålder i din provins, territorium eller land för att anmäla dig som registrerad användare av Produkterna. Personer under 18 år eller under myndig ålder får endast använda produkterna med en förälder eller vårdnadshavares medverkan och samtycke, under dennes personliga konto och i enlighet med dessa villkor. 
 4. Innan du avslöjar personuppgifter till en annan person måste du erhålla personens samtycke till såväl upplysningen som behandlingen av den personliga informationen i enlighet med denna policy. 
 5. Vi får använda din personliga information till: 
 * Anpassa våra plattformar för dig; 
 * Skicka e-postmeddelanden som du specifikt har begärt 
 * Skicka vårt nyhetsbrev till dig ifall du har begärt det (du kan när som helst informera oss om du inte längre behöver nyhetsbrevet);
 * Skicka dig marknadsföringskommunikation som rör vår verksamhet (eller företag som är noga utvalda tredje parter) som vi tycker kan vara av intresse för dig, per post eller, där du specifikt har kommit överens om detta, via e-post eller liknande teknik (du kan informera oss när som helst om att du inte längre behöver marknadsföringskommunikation);
 * Ge tredje part statistik kring våra användare (men de tredje parterna kommer inte att kunna identifiera någon enskild användare från den informationen);
 * Hantera förfrågningar och klagomål från eller om dig relaterade till vår applikation; 
 * Hålla vår applikation säker och förebygga bedrägeri;
 6. Vi kommer inte, utan ditt uttryckliga samtycke, lämna din personliga information till någon tredje part för deras eller någon annan tredje parts direkta marknadsföring. 
 7. Personliga uppgifter som vi behandlar för något ändamål eller ändamål får inte lagras längre än vad som är nödvändigt för detta eller dessa ändamål. 
 8. Uppladdat media: 
 * Du är ägare till innehållet och har samtycke från alla parter som visas i den. 
 * Videotester lagras på våra servrar så att du senare kan granska dem i historiken. Vi delar inte videoprov för marknadsföringsändamål eller med tredje part eller med andra användare.
 * Vi har rätt att dela media du laddar upp för utmaningar i vår annonsering, marknadsföring. 
 * På din förfrågan kommer vi alltid att radera eller redigera innehållet du har delat med oss. 
 9. Vi kommer att behålla dokument (inklusive elektroniska dokument) som innehåller personuppgifter: 
 * i den utsträckning som vi är skyldiga att göra det enligt lag;
 * Om vi anser att dokumenten kan vara relevanta för pågående eller framtida rättsliga förfaranden; och
 * för att etablera, utöva eller försvara våra juridiska rättigheter (inklusive information till andra i syfte att förebygga bedrägerier och minska kreditrisken). 
 10. Vi kommer att vidta rimliga tekniska och organisatoriska försiktighetsåtgärder för att förhindra förlust, missbruk eller förändring av din personliga information. 
 11. Vi lagrar all personlig information du tillhandahåller på våra säkra (lösenords- och brandväggsskyddade) servrar. 
 12. Du är införstådd med att överföringen av information via internet är osäker i dess natur, och vi kan inte garantera säkerheten för data som skickas över internet. 
 13. Du är ansvarig för att hålla lösenordet du använder för att få tillgång till vår applikation konfidentiell; Vi kommer inte att fråga dig om ditt lösenord (förutom när du loggar in i vår applikation). 
 14. Du får begära att vi korrigerar, redovisar eller tar bort all din personliga information som vi håller om dig genom att kontakta oss via e-post eller meddelandesystem inom applikationen. 
 15. Vår applikation innehåller hyperlänkar till och uppgifter om tredje parts webbplatser och vi har ingen kontroll över och ansvarar inte för tredjepartsintegritetspolicy och praxis. 
 16. Vi kan uppdatera denna policy från tid till annan genom att publicera en ny version i vår applikation och vi meddelar dig om ändringar i denna policy. 
 17. Denna ansökan ägs och drivs av Dogo App UG. Mer information om företaget: 
 * Vår huvudsakliga verksamhetssort ligger på Markgrafenstrasse 12-14, 10969, Berlin, Germany. 
 * Dataskyddsansvarig: Tadas Žiemys, tadas@dogo.app
